import React, { Component } from 'react';
import './MainContent.css';

class MainContent extends Component {
  render() {
    return (
      <div className="mainContainer">
        <div className="smallChild">
          <h1>Hey 1</h1>
        </div>
        <div className="mainChild">
          <h1>Main Child</h1>
        </div>
        <div className="smallChild">
          <h1>Hey 3</h1>
        </div>
      </div>
    );
  }
}

export default MainContent;
